import './App.css';
import Main from './book';
import Login from './login';
import { 
  BrowserRouter as Router, 
  Switch, 
  Route,
  Link
} from "react-router-dom"


function App() {
  return(
  <>
  <Router>
      <Switch>
        <Route path= "/">
          <Login />
        </Route>
        <Route  path= "/search">
          <Main />
        </Route>
      </Switch>
    </Router>
  </>
  );
}

export default App;
